import { FaShoppingCart } from "react-icons/fa";
import Logo from "./Logo.svg";
import { NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <div>
      <div className="flex justify-between">
        <Navlink>
          <div></div>
          <img src={Logo} alt="images will be displayed" />
        </Navlink>
        <div>
          <p>Home</p>
          <FaShoppingCart />
        </div>
      </div>
    </div>
  );
};

export default Navbar;
